import React from 'react';
import { useParams } from 'react-router-dom';
import Sidebar from "../Components/Sidebar";
import Mainbar from "../Components/Mainbar";
import AddMenu from './Admin_AddMenu';
import AddUser from './Admin_AddUser';
import AllUser from './Admin_AllUser';
import AdminHome from './Admin_Home';

function Admin_Page() {
  const { id } = useParams();
  return (
    <div >
      <main main className="flex bg-slate-100">
        {/* <div className="shadow-2xl  flex-[2] ">
          <Sidebar />
        </div> */}

        <div className="mx-3 flex-[9]">
          {/* <Mainbar /> */}
          {(() => {
            switch (id) {
                case "menu": return (<AddMenu /> );
                case "home": return (<AdminHome />);
                case "adduser": return (<AddUser /> );
                case "alluser": return (<AllUser /> );
                default: return "#FFFFFF";
            }
          })()}
        </div>
      </main>
    </div>
  );
}

export default Admin_Page;
